import React, {Component} from 'react'
import bg_img from './mock-up-images/Dashboard BG.svg'

class header extends Component {
    // State 
    state = {}

    // Render 
    render () {
        return (
            <React.Fragment>
                <img src={bg_img} style={{"background-size":"cover"}}/>
            </React.Fragment>
        )
    }
}

export default header
